        <img src="computers.png" alt="Avatar" className="card_img"/>
        <div className="container">
          <h4><b>{val.title}</b></h4> 
          <p>{val.para}</p> 
        </div>
      </div>
      </>
        )
    }
    
    console.log(prop);
    return(
    <>
{sdata.map(zcard)}
    </>
    )  

}

export default MyCard;
